(1488, 'À La Folie', 'rjtqA3nysoY', '2015-07-05 19:56:00', 1, 'a-la-folie', 'Bruno Slam', 'Nouveau titre de Kenedy.\r\n\r\nTélécharger sur iTunes : https://itunes.apple.com/fr/album/a-la-folie/id999433594?i=999434350\r\nTélécharger sur Google Play : https://play.google.com/store/music/album/Kenedy_A_la_folie?id=Bo5ju473jfqfgqk6a6rch4smxdy\r\n\r\nFan page : Kénédy\r\nhttp://facebook.com/PageKenedyMusic\r\nTwitter : Kenedy_Knd\r\nhttp://twitter.com/kenedy_knd\r\nInstagram : Kenedy_Knd\r\nhttp://instagram.com/kenedy_knd/\r\n\r\nAll cuts, dp and edits : Bruno Slam\r\nStyling : Greg Ambroisine\r\nHairStyle : Patrice Hephram\r\nMake Up : Leely MakeUp\r\nFigurant : Dimitri Jean-Baptiste\r\n\r\nRemerciements à Sergio "DAÖMEY" et Lorenz\r\n\r\nCompositeur : Dj Ken972\r\nAuteur : Kénédy\r\nAdditionnels : Oney / Ali Angel\r\nChoeurs : Kénédy / Euridee''s / Gregz\r\nMix / Mastering : Ali Angel\r\n\r\nÁ LA FOLIE - Kénédy\r\n\r\nNon ne venez pas me sauver de ce danger \r\nDans lequel j''ai perdu pieds depuis qu''il est\r\nN''imaginez pas que je me laisserai tenter\r\nNi magie, ni loi ne sauraient m''affronter \r\nSi même toutes vos promesses\r\nN''entrainent pas mes faiblesses\r\nSi jugement du reste qui saura me condamner\r\nOh oh... Je sais elle parait immense cette démence\r\nOh oh... C''est vrai quoi qu''on en dise quoi qu''on pense\r\n\r\nREFRAIN :\r\nOui de toi je m''oxygène \r\nde la folie qui m''empoisonne\r\nJe veux crier à en perdre haleine\r\nqu''à toi seul je m''abandonne\r\nOui de toi je m''oxygène \r\nÁ la folie je m''empoisonne\r\nJe veux crier à en perdre haleine\r\nqu''à toi seul je m''abandonne\r\n\r\nIl donne tout pour moi lui mon ecstasy\r\nÁ la vue de mes larmes il m''apaise aussi \r\nEt ses bras suffisent á calmer mes insomnies\r\nN''imaginez pas un jour de lui pouvoir me libérer\r\nNi magie, ni loi ne nous feraient céder\r\nEt même si ses promesses\r\nM''entrainent vers la détresse\r\nAu jugement céleste notre amour sera scellé... \r\n\r\nREFRAIN :\r\nOui de toi je m''oxygène \r\nde la folie qui m''empoisonne\r\nJe veux crier à en perdre haleine\r\nqu''à toi seul je m''abandonne\r\nOui de toi je m''oxygène \r\nÁ la folie je m''empoisonne\r\nJe veux crier à en perdre haleine\r\nqu''à toi seul je m''abandonne\r\n\r\nÁ la folie pour toi toi...\r\nOui ma vie c''est toi toi...\r\n\r\nÁ la folie pour toi toi \r\nOui ma vie c''est toi \r\nC''est toi, que toi\r\nJe ne veux que toi\r\nÁ la folie pour toi toi \r\nFinir dans tes bras... \r\nÁ la folie, ma vie c''est toi\r\n\r\nREFRAIN :\r\nOui de toi je m''oxygène \r\nde la folie qui m''empoisonne\r\nJe veux crier à en perdre haleine\r\nqu''à toi seul je m''abandonne\r\nOui de toi je m''oxygène \r\nÁ la folie je m''empoisonne\r\nJe veux crier à en perdre haleine\r\nqu''à toi seul je m''abandonne\r\n\r\nÁ la folie pour toi toi...\r\nOui ma vie c''est toi toi...', NULL, 'BrunoSlam', 0),
