(1687, 'Sé ou mwen lé', '9Ogpf5Fo1Ys', '2015-09-22 22:42:00', 1, 'se-ou-mwen-le', 'Your Zouk TV', 'Nouveau titre de Mainy\r\n\r\nRetrouvez le titre sur iTunes : https://itunes.apple.com/fr/album/se-ou-mwen-le-single/id1039851385 \r\nAUTEUR: MAINY \r\nCOMPOSITEUR:/MAINY/ JP VIVITUS\r\nARRANGEMENT : MAINY /DEEJAYW+\r\nGUITARE: KEVIN TORIS\r\nSTUDIO : JMR STUDIO\r\nMIXE: THIERRY ROBERT NAUDIN\r\nMASTERING : PMSTUDIO\r\nCLIP: REALISER PAR RADIX CORPORATION ET MPIX\r\nMAKE UP :ZEUDIA \r\nREMERCIEMENTS:\r\nMERCI A STEPHANIE-CALIXTE MONTLOUIS\r\nMERCI A CLAUDE CABIT POUR SA CONFIANCE ET SON  PROFESSIONALISME\r\nUN GRAND MERCI A PIERRE   DE LA SUITE VILLA AU TROIS ILETS\r\nMERCI A  CHRISTOPHE POUR LE DRONE \r\nET A JO DE TAXICAP\r\nMERCI A OGG MOON DE L OMBRE \r\nMERCI A US BARBERSHOP \r\nMERCI A RICARDO PONCE\r\nSE OU MWEN LE\r\n\r\nJe t’aime tu sais, t’es si jolie\r\nun peu beaucoup à la folie \r\nMon cœur s’emballe, il perd le nord\r\nsi tu me quittes, je perds ma vie, non \r\n \r\n s ‘il te plait laisse-moi mettre ton coeur\r\ndans la paume de ma main\r\nEt si demain tu n’as plus de chaleur \r\nParce que je t’aime et que je ne fais rien\r\nLaisse-moi tomber si tu es déçue\r\nJ’apprendrai à me relever même si ça me tue \r\n\r\n\r\n Refrain\r\nAn nou lévé\r\npou nou lové\r\nOn douce kimbé\r\npaske chewi ou sav sé ou mwen lé  \r\nmwen lè inmew toute la vie mwen\r\nvin pou kolew \r\npask doudou ou save sé ou mwen lé\r\n\r\n\r\nJe te veux jour et nuit \r\nsans regret et sans détour  \r\net si un jour tu me fuis ahhhhh\r\nJe ferai mon possible \r\npour recoller l’amour \r\nmais je ne suis pas pour le forcing ahhhh\r\n\r\nJe ne sais que ce n’est pas bien \r\nmais juré je ne joue pas moi\r\nSans toi je ne suis pas bien\r\nmais hélas tu ne me crois pas    \r\n\r\n \r\nRefrain\r\nAn nou lévé\r\npou nou lové\r\nOn douce kimbé\r\npaske chewi ou sav sé ou mwen lé  \r\nmwen lè inmew toute la vie mwen\r\nvin pou kolew \r\npask doudou ou save sé ou mwen lé\r\n\r\nfin\r\n\r\nbébé mwen pa vin pou joué\r\nA ce jeu t’es hot t’es trop douée\r\nMais fais attention à ne pas te brûler\r\nJe sais que t’as du vice je t’ai grillé \r\nbb mwen pa vin pou joué\r\nA ce jeu tes hot t est trop doué\r\nMais fais attention à ne pas te brûler\r\nJe sais que t’as du vice je t’ai grillé\r\n\r\n--\r\nYourZoukTv est la chaîne YouTube entièrement dédiée à toute la musique Caribéenne ! \r\nZouk, Dancehall, Traditions, Nouvelle scène créole, mais aussi contes, concerts, lives, Interviews ! \r\nRetrouvez tout l''esprit de la Caraïbe en quelques clics !\r\nAbonnez-vous : http://bit.ly/1gq5g8Z\r\nSITE - http://www.believedigitalstudios.com/\r\nFACEBOOK - https://www.facebook.com/YourZoukTv\r\nTWITTER - https://twitter.com/YourZoukTv', NULL, NULL, 0),
