(1800, 'Pour Toi', 'PEvF6h3-tzY', '2015-11-09 21:11:00', 1, 'pour-toi-1', 'MaylodiscProduction', 'Nouveau titre de Djelissa et T-jy\r\n\r\nSoutenez vos artistes en achetant le single avec les liens ci dessous:\r\nItunes: https://itunes.apple.com/fr/album/pour-toi-feat.-djelissa-single/id1049736042\r\nGoogle Play: https://play.google.com/store/music/album/T_Jy_Pour_toi_feat_Djelissa?id=Bsiulbp2sqy6jqcpanoqvs2jdua\r\n\r\nFacebook Djelissa: https://www.facebook.com/djelissazoukfanpage\r\nFacebook T-Jy:: https://www.facebook.com/tjy972\r\n\r\nCompositeur: Dj Tony438\r\nArrangeur: Dj Laconi (Adi Mix Production)\r\nAuteurs: Djelissa, T-Jy, Sharky FNZ\r\nInterprètes: Djelissa & T-Jy\r\nRecord & Mix: Doc P\r\nMastering: PM Studio\r\nMake Up: Mymy Make Up (https://www.facebook.com/Mymy-Make-up-721070434604476)\r\nEquipe Vidéo: Fred Digan\r\nDjelissa est habillée par: Ismelaine Cérito https://www.facebook.com/IsmelaineCerito\r\n© Maylodisc Production\r\nISRC: FR-26V-15-57690\r\nContact & Booking Djelissa: B-Low 06.78.36.69.44 / maylodisc@gmail.com\r\nContact & Booking T-Jy: Borx: 06.43.39.84.90\r\nLp.eventsproduction@gmail.com\r\n\r\nParoles Djelissa Feat T-Jy - Pour Toi (93 BPM)\r\n\r\nIntro:\r\nDjelissa\r\nT-Jy\r\nDj Tony\r\nMi love you baby\r\nOuh\r\nMaylodisc Production\r\nLp Event''s\r\nBiwa\r\nI Lou\r\nLova Lova\r\n\r\nCouplet 1:\r\nVin jwén Djelissa\r\nSi ou vlé évadé\r\nVini an place la\r\nSi ou vlé amizé\r\nNi  dé bél fanm \r\nDé bel nonm\r\nNi mizik ka résone\r\nChak moun an moun\r\nKa déhanché\r\nNi on dj ka mixé\r\nScéne la ka prend difé\r\nSé vou man té ka vizé\r\n\r\nRefrain:\r\nChéri j’te donnerais tout tout\r\n(Pour que je soit tiennes)\r\nFaire de toi mon essentiel \r\nJ’veux qu’tu m’appartiennes\r\nTout tout\r\n(Mon rayon de soleil)\r\nTe sentir prés de moi tous les jours m’émerveille\r\nDoudou ti chou\r\n(A pa zanmi aw ki pé fé sa stopé)\r\nL’anmou an nou\r\nSé douvan nou kay\r\nNou pé janmé cédé \r\n\r\nCouplet 2:\r\nJ’aimerais que tu soit la\r\nQue tu pen